import React, { Component } from "react";
import Form from "react-validation/build/form";
import Input from "react-validation/build/input";
import CheckButton from "react-validation/build/button";
// import AuthService from "../services/auth.service";
// import { PostData } from "./PostData";
import { Redirect, Switch } from 'react-router-dom';
import Header from './Header';
import Footer from './Footer'



const required = value => {
    if (!value) {
        return (
            <div className="alert alert-danger" role="alert">
                This field is required!
            </div>
        );
    }
};

export default class RegisterProject extends Component {

    constructor(props) {
        super(props);
        this.handleLogin = this.handleLogin.bind(this);
        this.onChangeUsername = this.onChangeUsername.bind(this);
        this.onChangePassword = this.onChangePassword.bind(this);

        this.state = {
          username: "",
          password: "",
          loading: false,
          message: ""
        };
      }
      componentDidMount () {
        const script = document.createElement("script");

        script.src = "./assets/dist/assets/js/pages/custom/wizard/wizard-1.js";
        script.async = true;


        document.body.appendChild(script);
    }


      onChangeUsername(e) {
        this.setState({
          username: e.target.value
        });
      }

      onChangePassword(e) {
        this.setState({
          password: e.target.value
        });
      }

      handleLogin(e) {
        e.preventDefault();

        this.setState({
          message: "",
          loading: true
        });

        this.form.validateAll();




    }


    render() {



        const {loading} = this.state;

        // if (this.state.redirectToReferrer) {
        //     return (<Redirect to={'/dashboard'} />)
        // }

        // if (sessionStorage.getItem('token')) {
        //     return (<Redirect to={'/dashboard'} />)
        // }



        return (

         <div>
           <Header />
  {/*begin::Main*/}
  {/*begin::Header Mobile*/}
  <div id="kt_header_mobile" className="header-mobile bg-primary header-mobile-fixed">
    {/*begin::Logo*/}
    <a href="index.html">
      <img alt="Logo" src="assets/media/logos/logo-letter-9.png" className="max-h-30px" />
    </a>
    {/*end::Logo*/}
    {/*begin::Toolbar*/}
    <div className="d-flex align-items-center">
      <button className="btn p-0 burger-icon burger-icon-left ml-4" id="kt_header_mobile_toggle">
        <span />
      </button>
      <button className="btn p-0 ml-2" id="kt_header_mobile_topbar_toggle">
        <span className="svg-icon svg-icon-xl">
          {/*begin::Svg Icon | path:assets/media/svg/icons/General/User.svg*/}
          <svg xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" width="24px" height="24px" viewBox="0 0 24 24" version="1.1">
            <g stroke="none" strokeWidth={1} fill="none" fillRule="evenodd">
              <polygon points="0 0 24 0 24 24 0 24" />
              <path d="M12,11 C9.790861,11 8,9.209139 8,7 C8,4.790861 9.790861,3 12,3 C14.209139,3 16,4.790861 16,7 C16,9.209139 14.209139,11 12,11 Z" fill="#000000" fillRule="nonzero" opacity="0.3" />
              <path d="M3.00065168,20.1992055 C3.38825852,15.4265159 7.26191235,13 11.9833413,13 C16.7712164,13 20.7048837,15.2931929 20.9979143,20.2 C21.0095879,20.3954741 20.9979143,21 20.2466999,21 C16.541124,21 11.0347247,21 3.72750223,21 C3.47671215,21 2.97953825,20.45918 3.00065168,20.1992055 Z" fill="#000000" fillRule="nonzero" />
            </g>
          </svg>
          {/*end::Svg Icon*/}
        </span>
      </button>
    </div>
    {/*end::Toolbar*/}
  </div>
  {/*end::Header Mobile*/}
  <div className="d-flex flex-column flex-root">
    {/*begin::Page*/}
    <div className="d-flex flex-row flex-column-fluid page">
      {/*begin::Wrapper*/}
      <div className="d-flex flex-column flex-row-fluid wrapper" id="kt_wrapper">
        {/*begin::Header*/}
        <div id="kt_header" className="header flex-column header-fixed">
          {/*begin::Top*/}
          <div className="header-top">
            {/*begin::Container*/}
            <div className="container">
              {/*begin::Left*/}
              <div className="d-none d-lg-flex align-items-center mr-3">
                {/*begin::Logo*/}
                <a href="index.html" className="mr-20">
                  <img alt="Logo" src="assets/media/logos/logo-letter-9.png" className="max-h-35px" />
                </a>
                {/*end::Logo*/}
                {/*begin::Tab Navs(for desktop mode)*/}
                <ul className="header-tabs nav align-self-end font-size-lg" role="tablist">
                  {/*begin::Item*/}
                  <li className="nav-item">
                    <a href="#" className="nav-link py-4 px-6 active" data-toggle="tab" data-target="#kt_header_tab_1" role="tab">Home</a>
                  </li>
                  {/*end::Item*/}
                  {/*begin::Item*/}
                  <li className="nav-item mr-3">
                    <a href="#" className="nav-link py-4 px-6" data-toggle="tab" data-target="#kt_header_tab_2" role="tab">Reports</a>
                  </li>
                  {/*end::Item*/}
                  {/*begin::Item*/}
                  <li className="nav-item mr-3">
                    <a href="#" className="nav-link py-4 px-6" data-toggle="tab" data-target="#kt_header_tab_2" role="tab">Orders</a>
                  </li>
                  {/*end::Item*/}
                  {/*begin::Item*/}
                  <li className="nav-item mr-3">
                    <a href="#" className="nav-link py-4 px-6" data-toggle="tab" data-target="#kt_header_tab_2" role="tab">Help Ceter</a>
                  </li>
                  {/*end::Item*/}
                </ul>
                {/*begin::Tab Navs*/}
              </div>
              {/*end::Left*/}
              {/*begin::Topbar*/}
              <div className="topbar bg-primary">
                {/*begin::Search*/}
                <div className="dropdown">
                  {/*begin::Toggle*/}
                  <div className="topbar-item" data-toggle="dropdown" data-offset="10px,0px">
                    <div className="btn btn-icon btn-hover-transparent-white btn-lg btn-dropdown mr-1">
                      <span className="svg-icon svg-icon-xl">
                        {/*begin::Svg Icon | path:assets/media/svg/icons/General/Search.svg*/}
                        <svg xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" width="24px" height="24px" viewBox="0 0 24 24" version="1.1">
                          <g stroke="none" strokeWidth={1} fill="none" fillRule="evenodd">
                            <rect x={0} y={0} width={24} height={24} />
                            <path d="M14.2928932,16.7071068 C13.9023689,16.3165825 13.9023689,15.6834175 14.2928932,15.2928932 C14.6834175,14.9023689 15.3165825,14.9023689 15.7071068,15.2928932 L19.7071068,19.2928932 C20.0976311,19.6834175 20.0976311,20.3165825 19.7071068,20.7071068 C19.3165825,21.0976311 18.6834175,21.0976311 18.2928932,20.7071068 L14.2928932,16.7071068 Z" fill="#000000" fillRule="nonzero" opacity="0.3" />
                            <path d="M11,16 C13.7614237,16 16,13.7614237 16,11 C16,8.23857625 13.7614237,6 11,6 C8.23857625,6 6,8.23857625 6,11 C6,13.7614237 8.23857625,16 11,16 Z M11,18 C7.13400675,18 4,14.8659932 4,11 C4,7.13400675 7.13400675,4 11,4 C14.8659932,4 18,7.13400675 18,11 C18,14.8659932 14.8659932,18 11,18 Z" fill="#000000" fillRule="nonzero" />
                          </g>
                        </svg>
                        {/*end::Svg Icon*/}
                      </span>
                    </div>
                  </div>
                  {/*end::Toggle*/}
                  {/*begin::Dropdown*/}
                  <div className="dropdown-menu p-0 m-0 dropdown-menu-right dropdown-menu-anim-up dropdown-menu-lg">
                    <div className="quick-search quick-search-dropdown" id="kt_quick_search_dropdown">
                      {/*begin:Form*/}
                      <form method="get" className="quick-search-form">
                        <div className="input-group">
                          <div className="input-group-prepend">
                            <span className="input-group-text">
                              <span className="svg-icon svg-icon-lg">
                                {/*begin::Svg Icon | path:assets/media/svg/icons/General/Search.svg*/}
                                <svg xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" width="24px" height="24px" viewBox="0 0 24 24" version="1.1">
                                  <g stroke="none" strokeWidth={1} fill="none" fillRule="evenodd">
                                    <rect x={0} y={0} width={24} height={24} />
                                    <path d="M14.2928932,16.7071068 C13.9023689,16.3165825 13.9023689,15.6834175 14.2928932,15.2928932 C14.6834175,14.9023689 15.3165825,14.9023689 15.7071068,15.2928932 L19.7071068,19.2928932 C20.0976311,19.6834175 20.0976311,20.3165825 19.7071068,20.7071068 C19.3165825,21.0976311 18.6834175,21.0976311 18.2928932,20.7071068 L14.2928932,16.7071068 Z" fill="#000000" fillRule="nonzero" opacity="0.3" />
                                    <path d="M11,16 C13.7614237,16 16,13.7614237 16,11 C16,8.23857625 13.7614237,6 11,6 C8.23857625,6 6,8.23857625 6,11 C6,13.7614237 8.23857625,16 11,16 Z M11,18 C7.13400675,18 4,14.8659932 4,11 C4,7.13400675 7.13400675,4 11,4 C14.8659932,4 18,7.13400675 18,11 C18,14.8659932 14.8659932,18 11,18 Z" fill="#000000" fillRule="nonzero" />
                                  </g>
                                </svg>
                                {/*end::Svg Icon*/}
                              </span>
                            </span>
                          </div>
                          <input type="text" className="form-control" placeholder="Search..." />
                          <div className="input-group-append">
                            <span className="input-group-text">
                              <i className="quick-search-close ki ki-close icon-sm text-muted" />
                            </span>
                          </div>
                        </div>
                      </form>
                      {/*end::Form*/}
                      {/*begin::Scroll*/}
                      <div className="quick-search-wrapper scroll" data-scroll="true" data-height={325} data-mobile-height={200} />
                      {/*end::Scroll*/}
                    </div>
                  </div>
                  {/*end::Dropdown*/}
                </div>
                {/*end::Search*/}
                {/*begin::Notifications*/}
                <div className="dropdown">
                  {/*begin::Toggle*/}
                  <div className="topbar-item" data-toggle="dropdown" data-offset="10px,0px">
                    <div className="btn btn-icon btn-hover-transparent-white btn-dropdown btn-lg mr-1 pulse pulse-white">
                      <span className="svg-icon svg-icon-xl">
                        {/*begin::Svg Icon | path:assets/media/svg/icons/Code/Compiling.svg*/}
                        <svg xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" width="24px" height="24px" viewBox="0 0 24 24" version="1.1">
                          <g stroke="none" strokeWidth={1} fill="none" fillRule="evenodd">
                            <rect x={0} y={0} width={24} height={24} />
                            <path d="M2.56066017,10.6819805 L4.68198052,8.56066017 C5.26776695,7.97487373 6.21751442,7.97487373 6.80330086,8.56066017 L8.9246212,10.6819805 C9.51040764,11.267767 9.51040764,12.2175144 8.9246212,12.8033009 L6.80330086,14.9246212 C6.21751442,15.5104076 5.26776695,15.5104076 4.68198052,14.9246212 L2.56066017,12.8033009 C1.97487373,12.2175144 1.97487373,11.267767 2.56066017,10.6819805 Z M14.5606602,10.6819805 L16.6819805,8.56066017 C17.267767,7.97487373 18.2175144,7.97487373 18.8033009,8.56066017 L20.9246212,10.6819805 C21.5104076,11.267767 21.5104076,12.2175144 20.9246212,12.8033009 L18.8033009,14.9246212 C18.2175144,15.5104076 17.267767,15.5104076 16.6819805,14.9246212 L14.5606602,12.8033009 C13.9748737,12.2175144 13.9748737,11.267767 14.5606602,10.6819805 Z" fill="#000000" opacity="0.3" />
                            <path d="M8.56066017,16.6819805 L10.6819805,14.5606602 C11.267767,13.9748737 12.2175144,13.9748737 12.8033009,14.5606602 L14.9246212,16.6819805 C15.5104076,17.267767 15.5104076,18.2175144 14.9246212,18.8033009 L12.8033009,20.9246212 C12.2175144,21.5104076 11.267767,21.5104076 10.6819805,20.9246212 L8.56066017,18.8033009 C7.97487373,18.2175144 7.97487373,17.267767 8.56066017,16.6819805 Z M8.56066017,4.68198052 L10.6819805,2.56066017 C11.267767,1.97487373 12.2175144,1.97487373 12.8033009,2.56066017 L14.9246212,4.68198052 C15.5104076,5.26776695 15.5104076,6.21751442 14.9246212,6.80330086 L12.8033009,8.9246212 C12.2175144,9.51040764 11.267767,9.51040764 10.6819805,8.9246212 L8.56066017,6.80330086 C7.97487373,6.21751442 7.97487373,5.26776695 8.56066017,4.68198052 Z" fill="#000000" />
                          </g>
                        </svg>
                        {/*end::Svg Icon*/}
                      </span>
                      <span className="pulse-ring" />
                    </div>
                  </div>
                  {/*end::Toggle*/}
                  {/*begin::Dropdown*/}
                  <div className="dropdown-menu p-0 m-0 dropdown-menu-right dropdown-menu-anim-up dropdown-menu-lg">
                    <form>
                      {/*begin::Header*/}
                      <div className="d-flex flex-column pt-12 bgi-size-cover bgi-no-repeat rounded-top" style={{backgroundImage: 'url(assets/media/misc/bg-1.jpg)'}}>
                        {/*begin::Title*/}
                        <h4 className="d-flex flex-center rounded-top">
                          <span className="text-white">User Notifications</span>
                          <span className="btn btn-text btn-success btn-sm font-weight-bold btn-font-md ml-2">23 new</span>
                        </h4>
                        {/*end::Title*/}
                        {/*begin::Tabs*/}
                        <ul className="nav nav-bold nav-tabs nav-tabs-line nav-tabs-line-3x nav-tabs-line-transparent-white nav-tabs-line-active-border-success mt-3 px-8" role="tablist">
                          <li className="nav-item">
                            <a className="nav-link active show" data-toggle="tab" href="#topbar_notifications_notifications">Alerts</a>
                          </li>
                          <li className="nav-item">
                            <a className="nav-link" data-toggle="tab" href="#topbar_notifications_events">Events</a>
                          </li>
                          <li className="nav-item">
                            <a className="nav-link" data-toggle="tab" href="#topbar_notifications_logs">Logs</a>
                          </li>
                        </ul>
                        {/*end::Tabs*/}
                      </div>
